db.patients.aggregate([
 { $unwind: "$IMMUNIZATIONS" },
 { $match: {"IMMUNIZATIONS.VACCINE_NAME": "Influenza seasonal injectable preservative free" } },
 { $group: {_id: "$PATIENT_ID"} },
 { $project: { _id: 0, patient_id: "$_id" } }
])

db.patients.aggregate([
  { $unwind: "$MEDICATIONS" },
  { $match: { "MEDICATIONS.MEDICATION_ID": "Simvastatin 10 MG Oral Tablet" } },
  { $group: { _id: "$MEDICATIONS.MEDICATION_ID", success_rate: { $avg: "$MEDICATIONS.SUCCESS_RATE" } } },
  { $project: { _id: 0, medication_id: "$_id", success_rate: 1 } }
])

db.medications.aggregate([
  {
    $match: {
      "NAME": "Warfarin Sodium 5 MG Oral Tablet",
      "COST": { $exists: true }
    }
  },
  {
    $project: {
      _id: 0,
      medication_name: "$NAME",
      cost: "$COST"
    }
  }
])

db.patients.aggregate([
 {
 $unwind: "$MEDICATIONS"
 },
 {
 $match: {
 "MEDICATIONS.MEDICATION_ID": "NDA020800 0.3 ML Epinephrine 1 MG/ML Auto-Injector",
 "MEDICATIONS.SUCCESS_RATE": { $exists: true }
 }
 },
 {
 $group: {
 _id: null,
 avgSuccessRate: { $avg: "$MEDICATIONS.SUCCESS_RATE" }
 }
 },
 {
 $project: {
 _id: 0,
 avgSuccessRate: 1
 }
 }
 ])

db.imaging\_studies.aggregate([
{
$match: {
"SERIES.SERIES\_INSTANCE\_UID": "1.2.840.99999999.1.57895833.1595237299924"
}
},
{
$project: {
SOP\_CLASS\_UID: 1,
SOP\_INSTANCE\_UID: 1,
SERIES: {
DESCRIPTION: "$SERIES.DESCRIPTION",
SERIES\_INSTANCE\_UID: "$SERIES.SERIES\_INSTANCE\_UID"
}
}
},
{
$group: {
\_id: "$SERIES.SERIES\_INSTANCE\_UID",
SOP\_CODE: { $first: "$SOP\_CLASS\_UID" },
SERIES\_DESCRIPTION: { $first: "$SERIES.DESCRIPTION" }
}
},
{
$project: {
\_id: 0,
SOP\_CODE: 1,
SERIES\_DESCRIPTION: 1
}
}
])

db.patients.aggregate([
 { $unwind: "$IMMUNIZATIONS" },
 { $match: {"IMMUNIZATIONS.VACCINE_TYPE": "Influenza seasonal injectable preservative free", "IMMUNIZATIONS.DATE_ADMINISTERED": { $exists: true } } },
 { $project: { _id: 0, immunization_date: "$IMMUNIZATIONS.DATE_ADMINISTERED" } }
])

db.patients.aggregate([
 { $unwind: "$TRANSACTIONS" },
 { $unwind: "$TRANSACTIONS.IMMUNIZATIONS" },
 { $match: {"TRANSACTIONS.IMMUNIZATIONS.DESCRIPTION": "Td (adult)  5 Lf tetanus toxoid  preservative free  adsorbed"}},
 { $group: {_id: null, total_cost: {$sum: "$TRANSACTIONS.TOTAL_COST"}}}
])

db.billing.aggregate([
  {
    $unwind: "$TRANSACTIONS"
  },
  {
    $unwind: "$TRANSACTIONS.ITEMS"
  },
  {
    $match: {
      "TRANSACTIONS.ITEMS.DESCRIPTION": "Influenza  seasonal  injectable  preservative free",
      "TRANSACTIONS.ITEMS.CODE_TYPE": "CPT",
      "TRANSACTIONS.ITEMS.CODE": "90658"
    }
  },
  {
    $group: {
      _id: null,
      total_base_cost: {
        $sum: {
          $multiply: [
            "$TRANSACTIONS.ITEMS.QUANTITY",
            "$TRANSACTIONS.ITEMS.PRICE"
          ]
        }
      }
    }
  },
  {
    $project: {
      _id: 0,
      total_base_cost: 1
    }
  }
])

db.patients.aggregate([
 { $unwind: "$PRESCRIPTIONS" },
 { $unwind: "$PRESCRIPTIONS.MEDICATIONS" },
 { $match: {"PRESCRIPTIONS.MEDICATIONS.NAME": "Acetaminophen 300 MG / Hydrocodone Bitartrate 5 MG Oral Tablet"}},
 { $project: { _id: 0, payer: "$PRESCRIPTIONS.PAYER.NAME" }}
])

db.patients.aggregate([
{ $match: { "FINDINGS.DESCRIPTION": "Allergy to substance" } },
{ $group: {_id: null, count: { $sum: 1 } } },
{ $project: { _id: 0, count: 1 } }
])

db.payer\_transactions.aggregate([
{
$match: {
"PAYER\_ID": "d31fccc3-1767-390d-966a-22a5156f4219"
}
},
{
$group: {
\_id: null,
total\_months: {
$sum: {
$trunc: {
divide: [
{
$subtract: [
"$TRANSACTION\_DATE",
ISODate("1970-01-01T00:00:00.000Z")
]
},
1000 \* 60 \* 60 \* 24 \* 30
]
}
}
}
}
},
{
$project: {
\_id: 0,
total\_months: 1
}
}
])

db.patients.aggregate([
 { $match: { "SUPPLIES.DESCRIPTION": "Blood glucose testing strips (physical object)"} },
 { $project: { _id: 0, PATIENT_ID: 1 } }
])

db.billing.aggregate([
  {
    $unwind: "$TRANSACTIONS"
  },
  {
    $unwind: "$TRANSACTIONS.ITEMS"
  },
  {
    $match: {
      "TRANSACTIONS.ITEMS.DESCRIPTION": "Influenza  seasonal  injectable  preservative free",
      "TRANSACTIONS.ITEMS.CODE_TYPE": "CPT",
      "TRANSACTIONS.ITEMS.CODE": "90658"
    }
  },
  {
    $group: {
      _id: null,
      total_base_cost: {
        $sum: {
          $multiply: [
            "$TRANSACTIONS.ITEMS.QUANTITY",
            "$TRANSACTIONS.ITEMS.PRICE"
          ]
        }
      }
    }
  },
  {
    $project: {
      _id: 0,
      total_base_cost: 1
    }
  }
])
